import mainLogo from "../../assets/logoMain.png"
import './Nav.scss'

const Nav = ({ authToken, setShowPopup, showPopup, setIsSignUp }) => {
  const handleClick = () => {
    setShowPopup(true);
    setIsSignUp(false);
  };

  return (
    <nav>
      <div className="nav-container">
        <img
          className="logo"
          src={mainLogo}
          alt="logo"
        />
        <h1>Furever</h1>
      </div>
      <div className="button-container">
      <button className="nav-button">Contact Us</button>
      <button className="nav-button">About Us</button>
      {!authToken && (
        <button
          className="nav-button"
          onClick={handleClick}
          disabled={showPopup}
        >
          Log in
        </button>
      )}
      </div>
    </nav>
  );
};
export default Nav;
